        private readonly GeoshipLoginData _geoshipLoginData;

        private const string WS_LANG = "EN";
        private const string VERSION = "v3c1";
        private const string APPLICATION_TYPE = "2";
        private const int COMPANY_ID = 5;

        private const double PARCEL_WEIGHT = 0.01;
        private const double PARCEL_WIDTH = 4.00;
        private const double PARCEL_HEIGHT = 5.00;
        private const double PARCEL_LENGHT = 10.00;

        private string _shipmentDate = null;
        private string ShipmentDate
        {
            get
            {
                if (_shipmentDate == null)
                {
                    var availableShippingDate = (DateTime.Now.TimeOfDay > new TimeSpan(15, 00, 00) ? DateTime.Now.AddDays(1) : DateTime.Now);

                    if (availableShippingDate.DayOfWeek == DayOfWeek.Saturday)
                    {
                        availableShippingDate = availableShippingDate.AddDays(2);
                    }
                    else if (availableShippingDate.DayOfWeek == DayOfWeek.Sunday)
                    {
                        availableShippingDate = availableShippingDate.AddDays(1);
                    }

                    _shipmentDate = availableShippingDate.ToString("yyyyMMdd");
                }

                return _shipmentDate;
            }
        }

        private string ShipmentTime = "1500";


        public GeoshipClient(IOptions<GeoshipLoginData> geoshipLoginData)
        {
            _geoshipLoginData = geoshipLoginData.Value;
        }

        private async Task<loginExtentedResponse1> LoginExtended()
        {
            var request = new loginExtented
            {
                wsUserName = _geoshipLoginData.Username,
                wsPassword = _geoshipLoginData.Password,
                wsLang = WS_LANG,
                applicationType = APPLICATION_TYPE,
                compId = COMPANY_ID,
                clientVO = new ClientVO
                {
                    version = VERSION,
                    operatingSystem = null,
                    hostname = _geoshipLoginData.Hostname,
                    appAssemblyName = null,
                    ipAddress = _geoshipLoginData.IpAddress
                }
            };

            var client = new LoginGeoshipWebservicesImplClient();

            var response = await client.loginExtentedAsync(request);

            return response;
        }

        private async Task<getCountryDataResponse> GetCoutryData(string country)
        {
            var request = new getCountryData
            {
                wsUserName = _geoshipLoginData.Username,
                wsPassword = _geoshipLoginData.Password,
                wsLang = WS_LANG,
                applicationType = APPLICATION_TYPE,
                searchParamsVO = new CountrySearchParamsVO
                {
                    countryName = country.ToUpper().Trim(),
                    shipmentFlag = "1"
                }
            };

            var client = new CountryServicesImplClient();

            var response = await client.getCountryDataAsync(request);

            return response;
        }

