        private async Task<saveShipmentResponse> SaveShipment(
            UserSessionVO userSession, 
            CountryVO countryData, 
            QGenWorkAreaZipcodeRangeByStreetNamePomVO workAreaData,
            SaveShipmentRequest saveShipmentRequest)
        {
            var payerContractData = userSession.payerContracts.Where(x => x.contractName == _geoshipLoginData.PayerContractName).First();
            var senderAddressData = userSession.senderAddressesVOArray.Where(x => x.customerContactVO.customerContactId == userSession.senderVO.contactId).First();

            var request = new saveShipment
            {
                wsUserName = _geoshipLoginData.Username,
                wsPassword = _geoshipLoginData.Password,
                wsLang = WS_LANG,
                applicationType = APPLICATION_TYPE,

                oprShipmentVO = new OprShipmentVO
                {
                    contractId = payerContractData.contractId,
                    compId = COMPANY_ID,
                    appOriginType = "2", // 0:SSA; 2:WPO; 5:ERP
                    pickupType = "1", // 0:Parcels Delivered to Depot; 1:Address Pick-up
                    collectionType = "2", // 0:Cash; 1:Banklink; 2:Forward
                    invoiceCurrency = payerContractData.invoiceCurrency, // optional
                    contractedFlag = payerContractData.contractedFlag ?? "0",
                    printOptionType = "0", // 0: I will print labels by myself; 1: I will use label from curier; 2: I have already preprinted labels

                    // PAYER
                    payerCustId = userSession.senderVO.custId,
                    payerAddressId = userSession.payersVOArray[0].addressId,
                    payerCountryId = userSession.payersVOArray[0].countryId,
                    // SENDER
                    senderCustId = userSession.senderVO.custId,
                    senderAreaId = senderAddressData.areaId,
                    senderZipCode = senderAddressData.zipCode,
                    senderCountryId = senderAddressData.countryId,
                    senderZoneId = senderAddressData.zoneId,
                    senderCityId = senderAddressData.cityId,
                    senderAdrId = senderAddressData.addressId,
                    // RECEIVER
                    receiverCountryId = workAreaData.countryId,
                    receiverZipCode = workAreaData.alphaZipCode,
                    receiverAreaId = workAreaData.workAreaId,
                    receiverCityId = workAreaData.cityId,
                    receiverCity = workAreaData.cityName,
                    receiverTownId = workAreaData.townId,
                    receiverWorkAreaId = workAreaData.workAreaId.Value,
                    receiverFirmName = null,
                    receiverName = $"{saveShipmentRequest.ReceiverFirstName} {saveShipmentRequest.ReceiverLastName}",
                    receiverAddressText = saveShipmentRequest.ReceiverAddressText,
                    receiverHouseNo = saveShipmentRequest.ReceiverHouseNumber,
                    receiverAdditionalAdrInfo = saveShipmentRequest.ReceiverAddressAdditionalInfo,
                    receiverTelArea = countryData.countryCallingCodeVOArray[0].countryCallingCode,
                    receiverTelNo = saveShipmentRequest.ReceiverPhoneNumber,
                    receiverContactName = null,
                    receiverEmailAddress = null,
                    receiverCustType = "0", // 0 = Individual, 1 = Company
                    // SHIPPMENT
                    shpDate = ShipmentDate,
                    shpTime = ShipmentTime,
                    totalKg = PARCEL_WEIGHT, // calculate total weight of all parcels (currently this is a constant)

                    shpMainProductId = 50496,
                    shipmentType = "SH",

                    departureTourNumber = senderAddressData.tourCode,
                    departureUnitId = senderAddressData.workingUnitId,
                    ssaCustProfileId = userSession.ssaCustProfileId,
                    ssaUserId = userSession.ssaUserId.Value,
                    numberOfCopies = 1,


                    oprShipmentAddInfoVO = new OprShipmentAddInfoVO
                    {
                        contractType = payerContractData.contractType,
                        realDepotId = payerContractData.realDepotId,
                        relatedBusinessUnitId = payerContractData.relatedBusinessUnitId,

                        senderHouseNo = senderAddressData.buildingNo,
                        senderStreet = senderAddressData.street,
                        senderTownId = senderAddressData.townId,

                        receiverTownName = workAreaData.townName,
                        receiverGsmArea = null, // copy from tel areal ?
                        receiverGsmNumber = null, // copy from tel number ?
                        receiverCompName = null,
                        receiverFirstName = saveShipmentRequest.ReceiverFirstName,
                        receiverLastName = saveShipmentRequest.ReceiverLastName,

                        labelCopyEmail = null,
                        workBranchUnitId = senderAddressData.workingUnitId
                    },

                    oprShpParcelVOArray = new OprShpParcelVO[1]
                    {
                        new OprShpParcelVO
                        {
                            kg = PARCEL_WEIGHT,
                            width = PARCEL_WIDTH,
                            height = PARCEL_HEIGHT,
                            length = PARCEL_LENGHT,
                            goodsPrice = (double)saveShipmentRequest.ProductPrice,
                            goodsCurrency = "EUR",
                            parcelCount = 1
                        }
                    },

                    oprShpProductsVOArray = new OprShpProductsVO[3]
                    {
                        new OprShpProductsVO
                        {
                            addServiceFlag = "0",
                            compProdFlag = "0",
                            oprProdStatusFlag = "1",
                            prodId = 50496, // DPD B2C (LV)
                            serviceDate = ShipmentDate,
                            contractId = payerContractData.contractId,
                            payerContractId = payerContractData.payerContractId
                        },
                        new OprShpProductsVO
                        {
                            addServiceFlag = "1",
                            compProdFlag = "1",
                            oprProdStatusFlag = "1",
                            notAffectServiceCode = "1",
                            prodId = 50492, // FUEL SURCHARGE (LV) - mandatory
                            serviceDate = ShipmentDate, // same as shippment date
                            contractId = payerContractData.contractId,
                            payerContractId = payerContractData.payerContractId
                        },
                        new OprShpProductsVO
                        {
                            addServiceFlag = "1",
                            compProdFlag ="1",
                            oprProdStatusFlag = "1",
                            notAffectServiceCode = "0",
                            prodId = 50277, // COD (LV)
                            serviceDate = ShipmentDate, // same as shippment date
                            contractId = payerContractData.contractId,
                            payerContractId = payerContractData.payerContractId,

                            oprShpProductFieldVOArray = new OprShpProductsFieldVO[4]
                            {
                                new OprShpProductsFieldVO
                                {
                                    prodFieldId = 50371, // Function field (technical)
                                    value = null // default value
                                },
                                new OprShpProductsFieldVO
                                {
                                    prodFieldId = 50372,  // Amount
                                    value = string.Format("{0:N2}", saveShipmentRequest.ProductPrice)
                                },
                                new OprShpProductsFieldVO
                                {
                                    prodFieldId = 50368, // Currency
                                    predefFieldId = 30012,
                                    predefFieldIdSpecified = true,
                                    value = "2" // EUR
                                    
                                },
                                new OprShpProductsFieldVO
                                {
                                    prodFieldId = 50369, // Payment type
                                    predefFieldId = 30011,
                                    predefFieldIdSpecified = true,
                                    value = "9" // Defualt
                                }
                            }
                        }
                    }
                }
            };

            var client = new ShipmentServicesImplClient();
            var response = await client.saveShipmentAsync(request);

            return response;
        }

        private async Task<closeManifest4GeoshipLabelResponse1> CloseManifest(UserSessionVO userSession, long shipmentId)
        {
            var senderAddressData = userSession.senderAddressesVOArray.Where(x => x.customerContactVO.customerContactId == userSession.senderVO.contactId).First();

            var request = new closeManifest4GeoshipLabel
            {
                wsUserName = _geoshipLoginData.Username,
                wsPassword = _geoshipLoginData.Password,
                wsLang = WS_LANG,
                applicationType = APPLICATION_TYPE,
                shipment4ManifestVOArray = new Shipment4ManifestVO[1]
                {
                    new Shipment4ManifestVO
                    {
                        shpId = shipmentId,
                        shpDate = ShipmentDate,
                        shipmentType = "REGULAR_SHIPMENT_TYPE"
                    }
                },
                manifestVo = new ManifestVO
                {
                    compId = COMPANY_ID,
                    printStatus = "1",
                    appOriginType = "2",
                    manifestCloseDate = DateTime.Now.ToString("yyyyMMdd"),
                    senderCustId = userSession.senderVO.custId.Value,
                    ssaCustProfileId = userSession.ssaCustProfileId,
                    ssaUserId = userSession.ssaUserId.Value,
                },
                unitId = senderAddressData.workingUnitId
            };

            var client = new ManifestServicesImplClient();
            var response = await client.closeManifest4GeoshipLabelAsync(request);

            return response;
        }

